column8:
あると便利な、ハシとスプーンのセットです。<br>
<br>
品質表示：<br>
本体フタ：ＡＳ樹脂　耐熱温度80度<br>
本体底　：ＡＢＳ樹脂　耐熱温度80度<br>
本体中皿：ポリプロピレン　耐熱温度90度<br>
箸　　　：メタクリル樹脂　耐熱温度80度<br>
スプーン持ち手：ＡＢＳ樹脂　耐熱温度80度<br>
スプーン：ステンレス鋼<br>
＜箸＞長さ　18cm　＜スプーン＞長さ18cm<br>
＜ケースサイズ＞約200×64×18mm<br>
●取り扱い上の注意<br>
アルカリ性洗剤またはオレンジオイル系洗剤は図柄が剥離する恐れがありますので使用しないでください。<br>
自動食器洗浄機はご使用にならないでください。<br>
生産国：日本

